import React from 'react'
// import styled from "styled-components"
// import {useTable, useSortBy} from "react-table"
// import InfiniteScroll from "react-infinite-scroll-component"

const MedPoint = () => {
    return(
    <div>
    <h1>지역별 선별 신료소 정보</h1>
    <table style={style}>
        <thead>지역별</thead>
    <tr>
        <td style={{width:"20%", border:"1px solid black"}}></td>
        <td style={{width:"15%", border:"1px solid black"}}></td>
        <td style={{width:"20%", border:"1px solid black"}}></td>
        <td style={{width:"10%", border:"1px solid black"}}></td>
        <td style={{width:"10%", border:"1px solid black"}}></td>
        <td style={{width:"25%", border:"1px solid black"}}></td>
        
    </tr>
    </table>
</div>
)}
export default MedPoint


// page shows static list of med points in selected area, then opens map when clicked on. 
// min 6 cols { 지역별 / 동읍면 / 상세 주소 / 전화번호 / 진료시간 / 주차가능여부 }
// div into two major td's: one of the list, other of map or enlarged details
// list should be editable as csv or the like. 

const style={
    width:"100%",
    height:"800px",
    margin:"0 auto", 
    align:"center",
    border:"1px solid black",

}
